import React, { useEffect, useRef, useState, useCallback } from 'react';
import '../styles/CloudShooter.css';
import { AZURE_ICON_CATEGORIES, SERVICE_MAPPINGS } from '../services/IconResolver';
import { soundManager } from '../services/SoundManager';

const CloudShooter = () => {
  // Canvas and game refs
  const canvasRef = useRef(null);
  const gameLoopRef = useRef(null);
  const lastTimeRef = useRef(0);

  // Game state
  const [gameStarted, setGameStarted] = useState(false);
  const [gameOver, setGameOver] = useState(false);
  const [score, setScore] = useState(0);
  const [timeLeft, setTimeLeft] = useState(60);
  const [playerName, setPlayerName] = useState('');
  const [highScores, setHighScores] = useState([
    { name: 'Eimis', score: 108 },
    { name: 'Eimis', score: 85 },
    { name: 'Eimis', score: 52 },
    { name: 'Eimis', score: 39 },
    { name: 'Eimis', score: 14 }
  ]);

  // Sound state
  const [soundsLoaded, setSoundsLoaded] = useState(false);
  const [isMuted, setIsMuted] = useState(false);

  // Mission state
  const [currentMission, setCurrentMission] = useState({ text: 'Shoot the Intune icons!' });

  // Toggle sound
  const toggleMute = useCallback(() => {
    setIsMuted(prev => !prev);
    soundManager.toggle();
  }, []);

  // Initialize canvas when component mounts
  useEffect(() => {
    const canvas = canvasRef.current;
    const ctx = canvas.getContext('2d');

    // Set canvas size
    canvas.width = 800;
    canvas.height = 600;

    // Initial canvas setup
    ctx.fillStyle = 'rgba(10, 25, 47, 0.95)';
    ctx.fillRect(0, 0, canvas.width, canvas.height);

    return () => {
      // Cleanup
      if (gameLoopRef.current) {
        cancelAnimationFrame(gameLoopRef.current);
      }
    };
  }, []);

  return (
    <div className="cloudShooter-container">
      <h1 className="cloudShooter-game-title">AZURE CLOUD SHOOTER</h1>

      <div className="cloudShooter-game-content">
        <div className="cloudShooter-main-area">
          <div className="cloudShooter-canvas-wrapper">
            <canvas ref={canvasRef} className="cloudShooter-game-canvas" />
          </div>

          <div className="cloudShooter-side-panel">
            <div className="cloudShooter-player-info">
              <div className="info-box">
                <div className="info-label">PLAYER:</div>
                <div className="info-value">{playerName}</div>
              </div>

              <div className="info-box">
                <div className="info-label">
                  <span role="img" aria-label="alien">üëæ</span> Score: 
                </div>
                <div className="info-value">
                  {score} <span role="img" aria-label="joystick">üïπÔ∏è</span>
                  {soundsLoaded && (
                    <button 
                      className="cloudShooter-sound-toggle"
                      onClick={toggleMute}
                      aria-label="Toggle sound"
                    >
                      {isMuted ? 'üîá' : 'üîä'}
                    </button>
                  )}
                </div>
              </div>

              <div className="info-box">
                <div className="info-label">TIME:</div>
                <div className="info-value">Time: {timeLeft}s</div>
              </div>
            </div>

            <div className="cloudShooter-score-explanation">
              <h4>HOW TO SCORE:</h4>
              <ul>
                <li>‚Ä¢ Hit correct icon: +5 points</li>
                <li>‚Ä¢ Height bonus: up to +20</li>
                <li>‚Ä¢ Wrong hit: -5 points</li>
                <li>‚Ä¢ Tip: Shoot icons as high as possible!</li>
              </ul>
            </div>

            <div className="cloudShooter-high-scores">
              <h4>HIGH SCORES</h4>
              <ul>
                {highScores.map((entry, index) => (
                  <li key={index}>
                    <span className="high-score-name">{entry.name}:</span> {entry.score}
                  </li>
                ))}
              </ul>
            </div>

            {currentMission.text && (
              <div className="cloudShooter-mission-container">
                <h4>CURRENT MISSION</h4>
                <div className="mission-text">
                  {currentMission.text}
                </div>
              </div>
            )}
          </div>
        </div>
      </div>
    </div>
  );
};

export default CloudShooter;
